import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class Email extends Component{
    constructor(props){
        super(props)
    }

render(){
    return(
        <div class="boxWrapped"> 
        <div class= "boxHolder">
            <div class="boxSend"> from: <br/>{props.email.sender}</div>
            <div class="boxRec"> to: <br/>{props.email.recipient}</div>
        </div>
        <div class= "boxHolder">
            <div class="boxSubject"> {props.email.subject}</div>
            <div class="boxDate"> {props.email.date}</div>
        </div>
            <div class="boxBody"> {props.email.message}</div>
        </div>
    )
}
}



Email.propTypes = {
    email : PropTypes.object    
}
